اللجنة العليا للمشاريع والإرث: 
يتواصل بناء استاد راس أبو عبود باستخدام حاويات الشحن البحري ومقاعد قابلة للتفكيك وبعد إسدال الستار على بطولة #قطر2022 سيُفكك استاد راس أبو عبود بالكامل وإعادة الاستفادة من أجزائه ما سيضع معايير جديدة في خطط استدامة وإرث المونديال
